import './App.css';

class App extends Component {
  render() {
  return (
    <div className="App container">
      <Navbar fluid collapseOnSelect>
        <Navbar.Brand>
        </Navbar.Brand>
      </Navbar> 
    </div>
  );
 }
}

export default App;
